function run() {

input = "{query}";
properDOI = input.replace (/(doi: *|^)(?=10.*\/)/gi,"https://doi.org/");
return properDOI;

}

# https://citation.crosscite.org/docs.html
# grep-pipe removes annoying month and issn field data
curl --silent -LH "Accept: application/x-bibtex" {query}
